import base64

data = {
    "selectedFile": "data:image/png;base64,"
}


import numpy as np
import cv2
# for flask , we dont pass any argument in function instead we will uncomment the 12,13,14 line
def getresult(image_string):
    # if request.method == 'POST':
    #     if "selectedFile" in request.json.keys():
    #         image_string = request.json.get("selectedFile")
            if image_string:
                try:
                    meta,data = image_string.split(",")
                    extension = (meta.split("/")[-1]).split(";")[0]
                    im_bytes = base64.b64decode(data)
                    # im_array is one-dim Numpy array, you can use it directly
                    im_array = np.frombuffer(im_bytes, dtype=np.uint8)
                    img = cv2.imdecode(im_array, flags=cv2.IMREAD_COLOR)
                    # you can use this img object anywhere. for example, I am saving it locally
                    cv2.imwrite(f"file_name.{extension}",img)
                    return {"success":"image upload successfully."}
                except:
                    return {"failed": "couldn't process the image data."}
    # else:
    #     return {"failed":"wrong or no key from frontend, required 'selectedFile' "}

getresult(data.get("selectedFile"))
